(function(){function init(){}
    function configure(){}
    function objectIsEmpty(obj){for(var key in obj){if(obj.hasOwnProperty(key)){return!1}}
        return!0}
    function objectHasProperty(obj,propertyName){if(objectIsEmpty(obj)){return!1}
        for(var key in obj){if(obj.hasOwnProperty(key)&&key===propertyName){return!0}}
        return!1}
    function array_get(array,key){var keys=key.split('.');for(var i=0;i<keys.length;i++){array=array[keys[i]]}
        return array}
    function trans(name,params){var template=null,trans=app.get('variables').get().trans;template=array_get(trans,name);if(template===null)return name;for(var keyParams in params){var reg=new RegExp('\:'+keyParams,'gi');template=template.replace(reg,params[keyParams])}
        return template}
    var API={init:init,configure:configure,objectIsEmpty:objectIsEmpty,objectHasProperty:objectHasProperty,trans:trans};window.ApplicationTools=API})()